Question:Design a Python function to determine if a given number is a perfect number. A perfect number is a number equal to the sum of all its factors plus 1. For example, 6 is a perfect number because it is the sum of 1, 2, 3, 6,  respectively. A perfect number must be a positive integer. Write a function that takes an integer as input and returns true if it is a perfect number and false otherwise.
```python
def isPerfectNumber(number):
    if number > 0:
        for i in range(1,number+1):
            if number % i == 0:
                sum = 0
                for j in range(1,i+1):
                    if i % j == 0:
                        sum += j
                if sum == number:
                    return True
        return False
    else:
        return False
```<|end_of_text|>

