Question:Build a Julia function that takes an array of numbers and returns the sum of all the even numbers in the array. If the array is empty, return 0.
```function sumEvenNumbers(arr) 
  if(arr == undefined || arr == null || arr.length == 0){
    return 0;
  } 
  var sum = 0;
  for(var i = 0; i < arr.length; i++){
    if((i % 2) == 0){
      sum += arr[i];
    }
  }
  return sum;
}
